import React, { Component } from 'react';
class HOME extends Component {

    state ={
        count: 0
    }
    styles = {
        fontSize:10,
        fontWeight:bold
    }

    render() { 
    return (
    <div>
        <h1>{this.formatCount()}</h1>
        <p style={this.styles}>{5+8}</p>
    </div>);
    }

    formatCount(){
        const {count} = this.state;
        return count === 0 ? 'zero' : count;
    }
    }
 
export default HOME;
